import { Grid } from "@mui/material";
import React from "react";

const SingleCategory = () => {
  return (
    <Grid sx={{ m: 1 }} container spacing={2}>
      <Grid item xs={12} sm={6}>
        Single Category
      </Grid>
    </Grid>
  );
};

export default SingleCategory;
